Присяга гражданина Санкт-Петербурга:

   Я, принимая звание гражданина этого города, заявляю, что: 

   - право быть гражданином Санкт-Петербурга дано мне Богом и никем иным, и лишить меня этого права не может никто и ничто, кроме моей совести; 

   - право быть гражданином Санкт-Петербурга не связано с моей национальностью, вероисповеданием, политическими или иными убеждениями; 

   - это право не связано с моим положением в обществе и родом моих занятий, оно не дает мне никаких привилегий по отношению к другим гражданам страны и мира; 

   - право считать себя гражданином Санкт-Петербурга возлагает на меня лишь одну обязанность: где бы я ни был и чем бы ни занимался, я буду сознавать себя причастным к сообществу людей, объединенных высокой петербургской духовностью, и ни одним моим поступком не нанесу ущерба интересам Великого Города.
